description:
This is the first official release from Misfit Toyz, the DJ duo from 808 Lab.

Contained within are 16 tracks that were independently produced by this group, with the exception of the remix tracks, where all credit goes to the original artist for the original composition.

This release is provided by the original composers. All that we ask is that you share this with others! Send us your feedback!

